import React from "react";
import "./App.css";

const Header = () => {
  return <h1>Hello sammi</h1>;
};

const Fields = () => {
  return <input type="text" placeholder="Typing..." />;
};

const App = () => {
  return (
    <div>
      <Header />
      <Fields />
    </div>
  );
};

export default App;
